import React, { Component } from "react";
import { View, Text, Button } from "react-native";
import TabBar from "./tabbar";

import { CheckFileExist, DownloadFile } from "../utilities/files";

//console.log(DownloadFile("ab.mp3"));
export default class HomePage extends Component {
  render() {
    this.menu = 0, this.book = 0, this.section = 0; //set default
    if (this.props.route.params) {
      //console.log("page: " + this.props.route.params.menu + ", " + this.props.route.params.book);
      if (
        typeof this.props.route.params.menu !== "undefined" && 
        typeof this.props.route.params.book !== "undefined" && 
        typeof this.props.route.params.section !== "undefined") {
          this.menu = this.props.route.params.menu;
          this.book = this.props.route.params.book;
          this.section = this.props.route.params.section;
      }
    }
    //console.log("init page");
    //console.log(FileInfo.doFileCheck("ab.mp3"));
    return <TabBar navigation={this.props.navigation} menu={this.menu} book={this.book} section={this.section} />;
  }
}
